import React from 'react';
import {Container} from 'react-bootstrap';

const Footer = () => (
   <Container fluid style={{backgroundColor:'#343a40', color:rgba(255,255,255,.75),padding:'30px 20px 20px'}}>
       <Container style={{display:'flex',justifyContent:'left',padding:'10px'}}>
         <p>Copyright © 2021 . all rights reserved.</p>  
       </Container>
   </Container>
)

export default Footer;
